import React, {Fragment} from 'react';
import {Breadcrumb, BreadcrumbItem} from "reactstrap";
import {IoIosMailOpen} from "react-icons/all";


const MyBreadcrumb = (currentPath) => (
    <Fragment>
        <Breadcrumb>
            <BreadcrumbItem>
                <IoIosMailOpen color="#63643" size={20}/>
            </BreadcrumbItem>
        </Breadcrumb>
    </Fragment>
)

export default MyBreadcrumb;
